import { Container, TextField } from "@mui/material";
import React from "react";

const login = () => {
  return (
    <div>
      <Container
        maxWidth="sm"
        style={{ height: "100px", backgroundColor: "white" }}
      >
        <div>Welcome</div>
        <div>God to see you</div>
      </Container>
      <Container>
        <TextField id="outlined-basic" variant="outlined" />
      </Container>
    </div>
  );
};

export default login;
